INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BPYPM', 'STOCK', 'Brookfield Property Preferred L.P.', 'NMS', NULL, NULL, NULL, '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EGAN', 'STOCK', 'eGain Corporation', 'NCM', 'Technology', 'Software - Application', 'eGain Corporation provides a knowledge platform for customer engagement. The Company offers a unified solution organized into three hubs eGain Knowledge Hub, eGain Conversation Hub, and eGain Analytics Hub, to automate, augment and orchestrate digital-first customer engagement. The eGain Knowledge Hub helps businesses to centralize knowledge, policies, procedures, situational expertise, and best practices, while delivering guided, personalized, and trusted answers to customers, agents, and field staff. Its eGain Conversation Hub offers capabilities for digital-first, omnichannel interaction management within a modern, purpose-built desktop. Applications, powered by its Knowledge and AI capabilities (from its Knowledge Hub), guide agents to efficiently interact with customers using chatbots, messaging applications, SMS, chat, email, phone, video, fax, and letter. Its eGain Analytics Hub enables clients to measure, manage and optimize their omnichannel service operations and knowledge.', 'Sunnyvale, CA, United States', 539);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BSMW', 'STOCK', 'Invesco Bulletshares 2032 Municipal Bond ETF', 'NGM', NULL, NULL, 'The fund generally will invest at least 80% of its total assets in securities that comprise the underlying index. The underlying index seeks to measure the performance of a portfolio of U.S. dollar-denominated investment-grade municipal bonds with maturities or, in some cases, “effective maturities,” in the year 2032 (collectively, “2032 Bonds”). The fund is non-diversified.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FIEE', 'STOCK', 'FiEE, Inc.', 'NCM', 'Technology', 'Communication Equipment', 'FiEE, Inc. is a technology company specializing in the Internet of Things (IoT), connectivity, and artificial intelligence (AI). The Company''s services are structured into categories, including the Cloud-Managed Connectivity (Wi-Fi) Platform, IoT Hardware Sales & Licensing, Software as a service (SAAS) Solutions, and Professional To-C and To-B Services & Support. Its Software as a Service (SaaS) solution integrates its AI and data analytics capabilities into content creation and brand management. This initiative assists Key Opinion Leaders (KOLs) on social media platforms in developing, managing, and optimizing their digital presence across global platforms. Its services include customized graphics and posts, short videos, and editorial calendars tailored to align with brand objectives. Additionally, its AI-powered cloud platform and applications streamline network management and security for homes, businesses, and service providers.', 'Tsuen Wan, , Hong Kong', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BCG', 'STOCK', 'Binah Capital Group, Inc.', 'NGM', 'Financial Services', 'Asset Management', 'Binah Capital Group, Inc. is a financial services enterprise. The Company operates through its subsidiary, Wentworth Management Services LLC. The Company is a consolidator of retail wealth management businesses that owns and operates 10 entities, four of which are broker-dealers, three of which are registered investment advisors, and three of which are insurance entities. Its portfolio companies help advisors run, manage, and execute commission-based business while providing resources to support their advisory practice. The Company, through four wholly owned broker-dealer subsidiaries and their affiliated entities, provides investment management services to clients via three advisor business models. The Company focuses on three critical areas, comprising the hybrid, independent and W2 business models. Through Wentworth Management Services LLC, it operates multiple businesses, including PKS Holdings, LLC, Cabot Lodge Securities LLC, Michigan Securities, Inc., and others.', 'Albany, NY, United States', 150);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CJET', 'STOCK', 'Chijet Motor Company, Inc.', 'NCM', 'Consumer Cyclical', 'Auto Manufacturers', 'Chijet Motor Co Inc is a company mainly engaged in the development, production and sales of new energy vehicles. The Companys products include plug-in electric vehicles, battery electric vehicles, plug-in hybrid (PHEV) electric vehicles and fuel cell electric vehicles.', 'Yantai, , China', 1378);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FAAR', 'STOCK', 'First Trust Alternative Absolute Return Strategy ETF', 'NGM', NULL, NULL, 'The fund is an actively managed exchange-traded fund that seeks to achieve long-term total return through long and short investments in exchange-traded commodity futures contracts ("Commodity Futures") through a wholly-owned subsidiary of the fund organized under the laws of the Cayman Islands (the "Subsidiary"). It does not invest directly in Commodity Futures. The advisor gains exposure to these investments exclusively by investing in the Subsidiary. The Subsidiary is advised by First Trust Advisors L.P., the fund''s investment advisor.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AFGE', 'STOCK', 'American Financial Group, Inc.', 'NYQ', NULL, NULL, 'American Financial Group, Inc. is an insurance holding company. Through the operations of Great American Insurance Group, the Company is engaged primarily in property and casualty insurance, focusing on specialized commercial products for businesses. The Companys segments include property and casualty insurance and Other. The property and casualty insurance business includes specialty sub-segments: property and transportation, which includes physical damage and liability coverage for buses and trucks and other specialty transportation niches, inland and ocean marine, agricultural-related products and other commercial property coverage; specialty casualty, which includes primarily excess and surplus, executive and professional liability, general liability, umbrella and excess liability, and specialty financial, which includes risk management insurance programs for lending and leasing institutions, fidelity and surety products and trade credit insurance.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CHEB', 'STOCK', 'Chenghe Acquisition II Co.', 'ASE', 'Financial Services', 'Shell Companies', 'Chenghe Acquisition II Co. is a blank check company. The Company is formed for the purpose of effecting a merger, share exchange, asset acquisition, share purchase, reorganization or similar business combination with one or more businesses or entities. It has not selected any specific business combination target and has not, nor has anyone on its behalf, engaged in any substantive discussions, directly or indirectly, with any business combination target with respect to an initial business combination. The Company may pursue an initial business combination target in any industry or geographic region. The Company intends to focus its search on growing companies in Asian markets or global companies with a presence or focus on Asia. The Company has no operations and has no revenues.', 'Jakarta, , Indonesia', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BIPH', 'STOCK', 'Safeplus International Holdings Limited', 'NYQ', NULL, NULL, NULL, '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('PATN', 'STOCK', 'Pacer Nasdaq International Patent Leaders ETF', 'NGM', NULL, NULL, 'The index is a rules-based full market capitalization-weighted index that consists of companies from the Nasdaq Global Ex United States Large Mid Cap Index with the most valuable patent portfolios. The fund will generally use a “replication” strategy to achieve its investment objective, meaning it will invest in all of the component securities of the index. The fund is non-diversified.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AGNCN', 'STOCK', 'AGNC Investment Corp.', 'NMS', 'Real Estate', 'REIT - Mortgage', 'AGNC Investment Corp. is an internally managed real estate investment trust (REIT). The Company provides private capital to the United States housing market, enhancing liquidity in the residential real estate mortgage markets and, in turn, facilitating home ownership in the United States. The Company invests primarily in Agency residential mortgage-backed securities (Agency RMBS) on a leveraged basis. These investments consist of residential mortgage pass-through securities and collateralized mortgage obligations for which the principal and interest payments are guaranteed by a United States Government-sponsored enterprise, such as the Federal National Mortgage Association (Fannie Mae) and the Federal Home Loan Mortgage Corporation (Freddie Mac, and together with Fannie Mae, the GSEs), or by a United States Government agency, such as the Government National Mortgage Association (Ginnie Mae). It may also invest in other assets related to the housing, mortgage or real estate markets.', 'Bethesda, MD, United States', 53);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASA', 'STOCK', 'ASA Gold and Precious Metals Limited', 'NYQ', 'Financial Services', 'Asset Management', 'ASA Gold and Precious Metals Limited is a publicly owned investment manager. The firm invests in the public equity markets across the globe. It primarily invests in stocks of companies engaged in the exploration, mining or processing of gold, silver, platinum, diamonds, or other precious minerals. It also invests in exchange traded funds. The firm employs fundamental analysis with a bottom-up approach to create its portfolios. The firm obtains external research to complement its in-house research. The firm is focused on covering the metals and mining sector. This record reflects the investment preferences or overall investment strategy of ASA Gold and Precious Metals Limited. ASA Gold and Precious Metals Limited was founded in 1958 and is based in Portland, Maine.', 'Portland, ME, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EAI', 'STOCK', 'Entergy Arkansas, Inc. 1M BD 4.875%66', 'NYQ', NULL, NULL, 'Entergy Arkansas, LLC is an integrated energy company engaged in electric power production, transmission and retail distribution operations. The Company provides electricity to approximately 728,000 customers in 63 counties. It delivers electricity to three million utility customers in Arkansas, Louisiana, Mississippi and Texas. The Company owns and operates one of the United States power generating fleets with approximately 30,000 megawatts of electric generating capacity, including 7,000 megawatts of nuclear power. The Company is a subsidiary of Entergy Corporation.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BRT', 'STOCK', 'BRT Apartments Corp.', 'NYQ', 'Real Estate', 'REIT - Residential', 'BRT Apartments Corp. is a real estate investment trust that owns, operates, and to a lesser extent, holds interests in joint ventures that own and operate multifamily properties. The Company owns or has interests in 30 multifamily properties with 8,161 units in 11 states; primarily in the Southeast United States and Texas. Generally, its multifamily properties are garden apartments and, to a lesser extent, mid-rise or town home style properties that provide residents with amenities, such as a clubhouse, swimming pool, laundry facilities and Internet access. In addition to its multifamily properties and preferred loan investments, the Company owns assets, and in particular, real estate assets. Its properties include Silvana Oaks Apartments, Avondale Station, Brixworth at Bridge Street, Newbridge Commons, Crossings of Bellevue, Avalon Apartments, Parkway Grande, Woodland Trails, Grove at River Place, Kilburn Crossing, The Woodland Apartments, The Pointe at Lenox Park, and among others.', 'Great Neck, NY, United States', 8);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BSMS', 'STOCK', 'Invesco BulletShares (R) 2028 Municipal Bond ETF', 'NGM', NULL, NULL, 'The fund generally will invest at least 80% of its total assets in securities that comprise the underlying index. The underlying index seeks to measure the performance of a portfolio of U.S. dollar-denominated investment-grade municipal bonds with maturities or, in some cases, “effective maturities,” in the year 2028 (collectively, “2028 Bonds”).', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BTBD', 'STOCK', 'BT Brands, Inc.', 'NCM', 'Consumer Cyclical', 'Restaurants', 'BT Brands, Inc. owns and operates approximately 15 restaurants, including Seven Burger Time fast-food restaurants located in the North Central region of the United States; Bagger Dave''s Burger Tavern, Inc. operates six Bagger Daves restaurants in Michigan, Ohio, and Indiana; Keegan''s Seafood Grille in Indian Rocks Beach, Florida (Keegan''s); Pie In The Sky Coffee and Bakery in Woods Hole, Massachusetts (PIE), and Schnitzel Haus is a German-themed fine dining restaurant and bar in Hobe Sound, Florida (Schnitzel). Burger Time restaurants feature a variety of burgers and other foods, sides, and soft drinks. Burger Time restaurants feature grilled hamburgers and other affordable foods such as chicken sandwiches, pulled pork sandwiches, sides, and soft drinks. Keegan''s offers a variety of traditional fresh seafood items for lunch and dinner. PIE features an array of freshly prepared baked goods, sandwiches, and its locally roasted coffee.', 'West Fargo, ND, United States', 40);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ELPC', 'STOCK', 'Companhia Paranaense de Energia', 'NYQ', 'Utilities', 'Utilities - Regulated Electric', 'A Companhia Paranaense de Energia, também conhecida como Copel, é uma empresa brasileira de energia elétrica. As atividades do escritório estão divididas em cinco segmentos: Geração e Transmissão de Energia (GET); Distribuição e Vendas de Energia (DIS); Telecomunicações (TEL); Gás; e Holding (HOL). O segmento GET inclui a geração de energia elétrica a partir de projetos hidráulicos, eólicos e térmicos; o transporte e transformação da energia gerada pela Companhia; e a construção, operação e manutenção de todas as subestações e linhas de transmissão de energia. O segmento DISs está focado na distribuição e venda de energia elétrica, e na operação e manutenção da infraestrutura de distribuição. O segmento TEL presta serviços de telecomunicações. O segmento de Gás está envolvido no serviço público de distribuição de gás natural canalizado. O SEGMENTO HOL consiste na participação em outras empresas. A Companhia atua no estado do Paraná.', 'Curitiba, PR, Brazil', 4396);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EDUC', 'STOCK', 'Educational Development Corporation', 'NGM', 'Communication Services', 'Publishing', 'Educational Development Corporation is a publishing company specializing in books for children. The Company is the owner and publisher of Kane Miller Books (Kane Miller); Learning Wrap-Ups, maker of educational manipulatives; and SmartLab Toys, maker of STEAM-based toys and games. It is also a distributor of Usborne Publishing Limited (Usborne) childrens books. Its segments include PaperPie and Publishing. The PaperPie segment markets its products through a network of independent brand partners using a combination of Internet sales, direct sales, home shows, and book fairs. The Publishing segment markets its products to retail accounts, which include books, school supplies, toy and gift stores, museums, trade and specialty wholesalers, through commissioned sales representatives, and its internal tele-sales group. This division also has in-house representatives marketing by telephone and email to other customers and potential customers.', 'Tulsa, OK, United States', 83);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AERT', 'STOCK', 'Aeries Technology, Inc', 'NCM', 'Industrials', 'Consulting Services', 'Aeries Technology, Inc. is a professional and management services company specializing in technology consulting. The Company establishes Global Capability Centers for Private Equity Portfolio Companies and delivers a suite of advisory and operations management services. The Companys advisory services involve providing strategic consulting solutions. Its operational management services include offering tailored offshoring solutions. The advisory service involves senior leadership offering recommendations on strategies, operating model design, appropriate approaches, and consultations regarding resource availability in the market. It provides services and solutions such as Consultancy Services, Operations Management Services, Digital Transformation, Artificial Intelligence (AI) Chatbot Solutions, Generative AI Large Language Model (GenAI LLM) Solutions, Cognitive Robotic Process Automation (RPA) Solutions, Data Analytics Solutions, Business Applications Accelerators, and Cloud Services.', 'Singapore, , Singapore', 1400);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BLTE', 'STOCK', 'Belite Bio, Inc', 'NCM', 'Healthcare', 'Biotechnology', 'Belite Bio, Inc is a clinical-stage biopharmaceutical drug development company. The Company is focused on advancing novel therapeutics targeting retinal degenerative eye disease, such as Geographic Atrophy (GA), age-related macular degeneration (AMD), and Stargardt disease type 1 (STGD1), both of which progressively lead to permanent blindness, and metabolic diseases such as non-alcoholic fatty liver disease (NAFLD), non-alcoholic steatohepatitis (NASH), type 2 diabetes (T2D), and gout. Its lead product candidate, Tinlarebant, is an oral daily treatment for STGD1 and GA patients. In STGD1, it is developing Tinlarebant as a once-a-day tablet treatment to target Retinol binding protein 4 (RBP4) by disrupting vitamin A (retinol) binding to RBP4, which leads to reduced delivery of retinol to the eye and reduced accumulation of toxic vitamin A by-products. Its product candidate also includes LBS-009, an anti-RBP4 oral therapy targeting liver disease, including NAFLD, NASH, and T2D.', 'San Diego, CA, United States', 25);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DTW', 'STOCK', 'DTE Energy Company JR SUB DB 2017 E', 'NYQ', NULL, NULL, 'A DTE Energy Company é uma empresa diversificada de energia, que está envolvida no desenvolvimento e gestão de negócios e serviços relacionados à energia em todo o país. Os segmentos da empresa incluem Electric, Gás, DTE Vantage, Energy Trading, Corporate e outros. O segmento elétrico consiste principalmente na DTE Electric, que está envolvida na geração, compra, distribuição e venda de eletricidade para clientes residenciais, comerciais e industriais no sudeste do Michigan. O segmento de gás consiste principalmente na DTE Gás, que está envolvida na compra, armazenamento, transporte, distribuição e venda de gás natural para clientes residenciais, comerciais e industriais em todo Michigan. O segmento DTE Vantage é composto principalmente de projetos de energia renovável que vendem eletricidade e gás de gasoduto e projetos que fornecem soluções de energia personalizada para clientes industriais, comerciais e institucionais. O segmento de Energy Trading consiste em operações de marketing ', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AHT', 'STOCK', 'Ashford Hospitality Trust, Inc.', 'NYQ', 'Real Estate', 'REIT - Hotel & Motel', 'Ashford Hospitality Trust, Inc. is a real estate investment trust (REIT). The Company''s portfolio consists of upscale hotels and upper upscale full-service hotels. The Company owns its lodging investments and conducts its business through Ashford Hospitality Limited Partnership (Ashford Trust OP). Its hotel properties are primarily branded under the brands of Hilton, Hyatt, Marriott and Intercontinental Hotel Group. The Company operates through one segment: direct hotel investments. It has a portfolio consisting of approximately 68 consolidated operating hotel properties, which represent over 16,736 total rooms. It owns a 15.1 % ownership in OpenKey, Inc. It owns four consolidated operating hotel properties, which represent 405 total rooms owned through a 99.0% ownership interest in Stirling REIT OP, LP (Stirling OP). The Company also has an investment in an entity that owns the Meritage Resort and Spa and the Grand Reserve at the Meritage (the Meritage Investment) in Napa, California', 'Dallas, TX, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMTD', 'STOCK', 'AMTD IDEA Group', 'NYQ', 'Financial Services', 'Asset Management', 'AMTD IDEA Group, formerly AMTD International Inc, is an investment holding company principally engaged in the strategic investments. The Company operates its business through three segments. The Strategic Investment segment engages in proprietary investments and the management of investment portfolios mainly focusing on financial services and asset classes. The Investment Banking segment is involved in raising funds through equity and debt financing, providing underwriting for initial public offerings (IPOs), private placements and debt issuances and providing financial advisory services. The Asset Management segment provides asset management products and services, including in relation to listed equities, fixed income securities, hedge funds, structured products, foreign exchange, private equities, alternative investments, discretionary account services, investment advisory services and external asset management services.', 'Paris, , France', 214);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DLHC', 'STOCK', 'DLH Holdings Corp.', 'NCM', 'Industrials', 'Specialty Business Services', 'DLH Holdings Corp. is a provider of science research and development, systems engineering and integration, and digital transformation and cyber security solutions to federal agencies. The Company is focused on improved deployment of health and defense initiatives for multiple agencies within the federal government, including the Department of Health and Human Services and Department of Defense. Its digital transformation and cyber security solutions include tools, such as artificial intelligence and machine learning, cloud enablement, cybersecurity ecosystem, big data analytics, and modeling and simulation. The Company''s science research and development solutions include data analytics, testing and evaluation, clinical trials research services, and epidemiology studies. Its systems engineering and integration solutions include system modernization, modeling, simulation & training, technology-enabled health solutions, software development, and robotics and unmanned systems.', 'Atlanta, GA, United States', 2800);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BNT', 'STOCK', 'Brookfield Wealth Solutions Ltd.', 'NYQ', 'Financial Services', 'Insurance - Diversified', 'Brookfield Wealth Solutions Ltd is a Bermuda-based company. The Company focuses on securing the financial futures of individuals and institutions through a range of wealth protection and retirement services, as well as tailored capital solutions. Through its operating subsidiaries, it offers insurance products and services, including annuities, personal and commercial property and casualty insurance, and life insurance. The Company''s segments include Annuity, Life Insurance, Property and Casualty (P&C), and Corporate and Other. The Annuity segment provides annuity-based products to individuals and institutions. The Life Insurance segment offers Whole Life Insurance, Universal Life Insurance, Variable Universal Life Insurance, and Credit Life Insurance products. The P&C segment provides property and casualty products, including coverage for personal, agribusiness, and certain commercial and specialty exposures. The Corporate and Other segment includes investment warehousing activities.', 'Pembroke, , Bermuda', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BYSI', 'STOCK', 'BeyondSpring Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'BeyondSpring Inc. is a clinical-stage biopharmaceutical company. The Company is focused on developing therapies to improve clinical outcomes for patients with high unmet medical needs. Its lead asset, Plinabulin, is in late-stage clinical development as an anti-cancer agent in non-small cell lung cancer (NSCLC) and a range of cancer indications. The Companys mechanism of action as a dendritic cell maturation agent supports both anti-cancer activity and immune modulation, offering an approach to resensitizing tumors to checkpoint inhibitors. It also has a pipeline of immuno-oncology product candidates, BPI-002 program, which is based on an oral small molecule agent that increases T-cell co-stimulation; BPI-003 program, which is based on a small molecule inhibitor of IKK, a protein kinase, and BPI-004 program, which is focused on a small molecule that induces the production of neo-antigens by tumor cells, allowing tumors containing no immune cells to be infiltrated by the immune system.', 'Florham Park, NJ, United States', 40);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CMCT', 'STOCK', 'Creative Media & Community Trust Corporation', 'NCM', 'Real Estate', 'REIT - Office', 'Creative Media & Community Trust Corporation is a real estate investment trust. The Company is a vertically integrated community-focused real estate and infrastructure owner, operator, lender and developer. It primarily acquires, develops, owns, and operates both premier multifamily properties situated in communities throughout the United States and Class A and creative office real assets in markets. Its segments consist of three types of commercial real estate properties, namely office, hotel and multifamily, as well as a segment for the Companys lending business. The products for the Companys office segment primarily include rental of office space and other tenant services, including tenant reimbursements, parking, and storage space rental. The products for the Companys hotel segment include operations of hotel properties. The loan segment includes the sale of the government-guaranteed portion of loans receivable and income from the yield on its loans receivable.', 'Dallas, TX, United States', 5);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('LEDS', 'STOCK', 'SemiLEDs Corporation', 'NCM', 'Technology', 'Semiconductors', 'SemiLEDs Corp is a Taiwan-based company mainly engaged in the development, manufacture and sale of light emitting diode (LED) chips and LED components, LED modules and systems. The Companys products are used for general lighting and specialty industrial applications, including ultraviolet, curing of polymers, LED light therapy in medical/cosmetic applications, counterfeit detection, germicidal and viricidal devices LED lighting for horticulture applications, architectural lighting and entertainment lighting.', 'Chu-Nan, , Taiwan', 116);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CHSCL', 'STOCK', 'CHS Inc.', 'NMS', 'Consumer Defensive', 'Farm Products', 'CHS Inc. is an integrated agricultural company, which provides grain, food, agronomy and energy resources to businesses and consumers on a global basis. It provides a variety of products and services, ranging from initial agricultural inputs such as fuels, farm supplies, crop nutrients and crop protection products to agricultural outputs that include grain and oilseed, processed grain and oilseed, renewable fuels and food products. It operates through three segments: Energy, Ag and Nitrogen Production. Its Energy segment produces and sells (primarily wholesale) gasoline, diesel fuel, propane, asphalt, lubricants and other related products, and also provides transportation services. Its Ag segment includes global grain and processing, ag retail and wholesale agronomy businesses. Its Nitrogen Production segment consists of its equity method investment in CF Industries Nitrogen, LLC (CF Nitrogen), which produces nitrogen-based products, including methanol, UAN, urea and related products.', 'Inver Grove Heights, MN, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('APOS', 'STOCK', 'Apollo Global Management, Inc. ', 'NYQ', NULL, NULL, 'Apollo Global Management, Inc. is a global alternative asset manager and a retirement services provider. It operates through three segments: Asset Management, Retirement Services and Principal Investing. The Asset Management segment focuses on three investing strategies: yield, hybrid, and equity. These strategies reflect the range of investment capabilities across its platform based on relative risk and return. The Retirement Services business is conducted by Athene Holding Ltd (Athene), a financial services company that specializes in issuing, reinsuring, and acquiring retirement savings products designed for the increasing number of individuals and institutions seeking to fund retirement needs. Athene product lines include annuities and funding agreements. The Principal Investing segment includes realized performance fee income, realized investment income from its balance sheet investments, and certain allocable expenses related to corporate functions supporting the entire company.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BWFG', 'STOCK', 'Bankwell Financial Group, Inc.', 'NGM', 'Financial Services', 'Banks - Regional', 'Bankwell Financial Group, Inc. is a bank holding company, which offers a range of financial services through its banking subsidiary, Bankwell Bank (the Bank). The Bank is a Connecticut state chartered commercial bank. It offers a range of commercial lending products, including owner-occupied commercial real estate loans, commercial real estate investment loans, commercial loans, such as business term loans, equipment financing and lines of credit to small and medium-sized businesses and real estate construction and development loans. It offers traditional depository products, including checking, savings, money market and certificates of deposit. It offers real estate loans for owner-occupied commercial properties as well as commercial property owned by real estate investors. Its construction portfolio includes loans to small and medium-sized businesses to construct owner-used properties, loans to developers of commercial real estate investment properties and residential developments.', 'New Canaan, CT, United States', 160);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CIX', 'STOCK', 'CompX International Inc.', 'ASE', 'Industrials', 'Security & Protection Services', 'CompX International Inc. is a manufacturer of security products used in postal, recreational transportation, office and institutional furniture, cabinetry, tool storage, healthcare and a variety of other industries. The Company is also a manufacturer of wake enhancement systems, stainless steel exhaust systems, gauges, throttle controls and trim tabs for the recreational marine industry. The Company operates through two segments: Security Products and Marine Components. The Security Products segment manufactures mechanical and electrical cabinet locks and other locking mechanisms used in a variety of applications, including mailboxes, ignition systems, file cabinets, desk drawers, tool storage cabinets, secured narcotics boxes and others. The Marine Components segment manufactures and distributes wake enhancement systems, stainless steel exhaust components, gauges, trim tabs and related hardware and accessories primarily for ski/wakeboard boats (towboats) and performance boats.', 'Dallas, TX, United States', 510);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CIF', 'STOCK', 'MFS Intermediate High Income Fund', 'NYQ', 'Financial Services', 'Asset Management', 'MFS Intermediate High Income Fund is a closed ended fixed income mutual fund launched and managed by Massachusetts Financial Services Company. The fund invests in fixed income markets of the United States. It primarily invests in high income debt instruments. The fund benchmarks the performance of its portfolio against Barclays U.S. High-Yield Corporate 2% Issuer Capped Index. It was formerly known as Colonial Intermediate High Income Fund. MFS Intermediate High Income Fund was founded in July 21, 1988 and is domiciled in United States.', 'Boston, MA, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASRV', 'STOCK', 'AmeriServ Financial, Inc.', 'NGM', 'Financial Services', 'Banks - Regional', 'AmeriServ Financial, Inc. is the parent of AmeriServ Financial Bank (the Bank). The Bank provides full-service banking and wealth management services through 16 community offices in southwestern Pennsylvania and Hagerstown, Maryland. The Bank also operates loan production offices in Altoona and Monroeville, Pennsylvania. The Bank provides retail banking services, such as demand, savings and time deposits, checking accounts, money market accounts, secured and unsecured consumer loans, mortgage loans, safe deposit boxes, holiday club accounts, and money orders; and lending, depository and related financial services to commercial, industrial, financial, and governmental customers, such as commercial real estate mortgage loans (CRE), short and medium-term loans, revolving credit arrangements, lines of credit, inventory and accounts receivable financing, real estate construction loans, business savings accounts, and others. AmeriServ Wealth and Capital Management is a division of the Bank.', 'Johnstown, PA, United States', 309);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ATHS', 'STOCK', 'Athene Holding Ltd. 7.250% Fixe', 'NYQ', NULL, NULL, 'Athene Holding Ltd. is a retirement services company. The Company is focused on providing financial security to individuals by offering a suite of retirement income and savings products and also serves as a solutions provider to corporations. The Company principally offers two product lines: annuities and funding agreements. Its primary product line is annuities, which include fixed, payout and group annuities issued in conjunction with pension group annuity transactions. It also offers funding agreements, including those issued to institutions via direct issuances and those issued to special-purpose unaffiliated trusts in connection with its funding agreement backed notes and secured funding agreement backed repurchase agreement programs. It has developed four dedicated distribution channels to address the retirement services market: retail, flow reinsurance, institutional, and acquisitions and block reinsurance. It has operations in the United States, Bermuda, Canada, and Japan.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CSB', 'STOCK', 'VictoryShares US Small Cap High Div Volatility Wtd ETF', 'NGM', NULL, NULL, 'The fund seeks to achieve its investment objective by investing, under normal market conditions, at least 80% of its assets directly or indirectly in the securities included in the Nasdaq Victory U.S. Small Cap High Dividend 100 Volatility Weighted Index, an unmanaged, volatility weighted index maintained exclusively by the index provider. The index identifies the 100 highest dividend yielding stocks in the Nasdaq Victory U.S. Small Cap 500 Volatility Weighted Index.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CVKD', 'STOCK', 'Cadrenal Therapeutics, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Cadrenal Therapeutics, Inc. is a late-stage biopharmaceutical company focused on the development of tecarfarin, a new phase III-ready oral vitamin K antagonist anticoagulant to address unmet needs in anticoagulation therapy. Tecarfarin is a novel and reversible anticoagulant designed to prevent heart attacks, strokes, and deaths due to blood clots in patients with rare cardiovascular conditions requiring chronic anticoagulation. It is pursuing a product-in-a-pipeline approach with tecarfarin. Tecarfarin has orphan drug designation (ODD) for advanced heart failure patients with implanted mechanical circulatory support devices, including left ventricular assisted devices (LVADs). The Company also has ODD and fast-track status for tecarfarin in end-stage kidney disease and atrial fibrillation (ESKD+AFib). With tecarfarin, it is advancing a solution to address the unmet needs in anticoagulation therapy, aiming to reduce the clinical complexities of warfarin, a vitamin K antagonist.', 'Ponte Vedra, FL, United States', 4);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CZNC', 'STOCK', 'Citizens & Northern Corporation', 'NCM', 'Financial Services', 'Banks - Regional', 'Citizens & Northern Corporation is a holding company whose principal activity is community banking. The Bank is a Pennsylvania banking institution. It provides a range of banking services, including deposit and loan products for personal and commercial customers. The Bank also provides wealth management services through its trust department and C&N Financial Services, LLC (CNFS). The trust department offers a wide range of financial services, such as 401(k) plans, retirement planning, estate planning, estate settlements and asset management. CNFS, a wholly owned subsidiary of the Bank, is a licensed insurance agency that provides insurance products to individuals and businesses and, through a broker-dealer arrangement, offers mutual funds, annuities, educational savings accounts and other investment products through registered agents. The Bank has 28 branch offices, including 21 in the northern tier/Northcentral region of Pennsylvania, and one in the Southern tier of New York State.', 'Wellsboro, PA, United States', 386);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CMT', 'STOCK', 'Core Molding Technologies, Inc.', 'ASE', 'Basic Materials', 'Specialty Chemicals', 'Core Molding Technologies, Inc. is an engineered materials company, which is specialized in the molding of thermoplastic and thermoset structural products. The Company produces and sells molded products for varied markets, including medium and heavy-duty trucks, power sports, building products, industrial and utilities and other commercial markets. The Company offers customers a wide range of manufacturing processes to fit various program volumes and investment requirements. These processes include compression molding of sheet molding compound (SMC), resin transfer molding (RTM), liquid molding of dicyclopentadiene (DCPD), spray-up and hand-lay-up, direct long-fiber thermoplastics (D-LFT) and structural foam and structural web injection molding (SIM). Its products include shielding, vehicle roofs, hoods, marine, structural reinforcements, class-a body panels, telecommunication equipment, aftermarket styling, industrial fan blades, consumer goods, and sheet molding compound.', 'Columbus, OH, United States', 1570);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALCO', 'STOCK', 'Alico, Inc.', 'NMS', 'Consumer Defensive', 'Farm Products', 'Alico, Inc. is an agribusiness and land management company. The Company operates as a diversified land company with approximately 51,300 acres across eight Florida counties. The Company focuses on strategic land development opportunities and diversified agricultural operations. The Company operates in two segments: Alico Citrus and Land Management and Other Operations. Alico Citrus includes activities related to planting, owning, cultivating and/or managing citrus groves to produce fruit for sale to fresh and processed citrus markets, including activities related to the purchase and resale of fruit and value-added services, which include contracting for the harvesting, marketing and hauling of citrus. Land Management and Other Operations include activities related to grazing and hunting, leasing, management and/or conservation of unimproved native pastureland and activities related to rock mining royalties and other insignificant lines of business.', 'Fort Myers, FL, United States', 199);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BRTR', 'STOCK', 'iShares Total Return Active ETF', 'NGM', NULL, NULL, 'The fund typically invests more than 90% of its assets in a diversified portfolio of fixed-income securities such as corporate bonds and notes, mortgage-backed securities, asset-backed securities, convertible securities, preferred securities and government obligations. Both U.S. and foreign companies and governments may issue these securities. Under normal circumstances, the fund invests primarily in fixed-income securities. It may invest in fixed-income securities of any duration or maturity.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMID', 'STOCK', 'Argent Mid Cap ETF', 'NGM', NULL, NULL, 'The fund is an actively managed ETF that seeks to achieve its investment objective by investing in the equity securities of mid-capitalization companies (i.e., companies with market capitalizations in the range of the Russell MidCap® Index that the Sub-Adviser believes are undergoing positive internal and/or external change.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DMXF', 'STOCK', 'iShares ESG Advanced MSCI EAFE Index ETF', 'NGM', NULL, NULL, 'The underlying index is a free float-adjusted market capitalization-weighted index that is designed to reflect the equity performance of large- and mid-capitalization developed market companies, excluding the U.S. and Canada. The fund generally will invest at least 90% of its assets in the component securities of the underlying index.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CDL', 'STOCK', 'VictoryShares US Large Cap High Div Volatility Wtd ETF', 'NGM', NULL, NULL, 'The fund seeks to achieve its investment objective by investing at least 80% of its assets directly or indirectly in the securities included in the Nasdaq Victory U.S. Large Cap High Dividend 100 Volatility Weighted Index. The index universe begins with the stocks included in the Nasdaq Victory U.S. Large Cap 500 Volatility Weighted Index, a volatility weighted index comprised of the 500 largest U.S. companies by market capitalization with positive earnings over the last twelve months.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BRLS', 'STOCK', 'Borealis Foods Inc.', 'NCM', 'Consumer Defensive', 'Packaged Foods', 'Borealis Foods Inc. is an integrated food science and manufacturing company. The Company has developed a range of affordable, sustainable, and nutritious ready-to-eat meals sold in the United States, Canada, Central America, South America and Europe. Through its ramen noodle brands, including the high protein Chef Woo, Ramen Express, and Woodles, the Company is focused on bringing the fusion flavors from diverse culinary traditions, creating nutritious meal options for consumers. Chef Woo instant ramen includes 20 grams of plant-based complete protein that is kosher, halal, vegan, and vegetarian certified, egg and dairy-free, TBHQ and added MSG free, and available in flavors, such as Roasted Chicken, Braised Beef, Spicy Tequila Lime, Thai Lemongrass, Sweet Chili Togarashi, and Chili Chicken. Woodles is a whole grain-rich ramen noodles designed to provide a healthier alternative to traditional ramen, particularly for school meal programs.', 'Oakville, ON, Canada', 147);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CMSA', 'STOCK', 'CMS Energy Corporation 5.6% JRSUB NT 78', 'NYQ', NULL, NULL, 'A CMS Energy Corporation é uma empresa de energia que opera principalmente em Michigan. Gere os seus negócios pela natureza dos serviços que cada um presta e opera principalmente em três segmentos de negócio: Electric Utility, Gás Utility e Northstar Clean Energy. O segmento de Utilidade Elétrica consiste em atividades regulamentadas associadas à geração, compra, distribuição e venda de eletricidade em Michigan. O segmento de Gás Utility consiste em atividades regulamentadas associadas à compra, transmissão, armazenamento, distribuição e venda de gás natural em Michigan. O segmento de Energia Limpa Northstar consiste em várias subsidiárias que se envolvem na produção de energia independente nacional, incluindo o desenvolvimento e operação de geração renovável, e a comercialização de produção de energia independente. Seu sistema de transmissão, armazenamento e distribuição de gás consiste em 2 342 quilômetros de linhas de transmissão com 15 campos de armazenamento de gás com uma capacid', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CGO', 'STOCK', 'Calamos Global Total Return Fund', 'NGM', 'Financial Services', 'Asset Management', 'Calamos Global Total Return Fund is a closed ended balanced mutual fund launched by Calamos Investments LLC. It is managed by Calamos Advisors LLC. The fund invests in public equity and fixed income markets across the globe. It seeks to invest in securities of companies operating across diversified sectors. The fund primarily invests in equities, convertible bonds, and high yield corporate bonds. It employs both fundamental and quantitative analysis to create its portfolio. The fund benchmarks the performance of its portfolio against MSCI World Index. Calamos Global Total Return Fund was formed on March 30, 2004 and is domiciled in the United States.', 'Naperville, IL, United States', NULL);\n
